import React from 'react';
export function List(props) {
  if(props.item) {
    return (
      <ul className="App-list">
        {props.items.map((item, i) => (
          <li key={i}>
            <h4>{item.name}</h4>
            <p>{item.model}</p>
            <button>
              Edit
            </button>
            <button>
              Delete
            </button>
          </li>
        ))}
      </ul>
    )
  }else {
    <p>All items has been clear!</p>
  }

}
